    //cmnd
    setTimeout(function(){
      const input114= document.getElementById('input-114');
      if (input114) {
          input114.value = cmnd;
          triggerEvent(input114, 'input');
      }
      },t5);  

    //noi cap
    setTimeout(function(){
      const input123= document.getElementById('input-123');
